use soccer;
Drop table  if exists statistics;
Create table statistics (
player_id BIGINT PRIMARY KEY , 
games_appearences INT,
games_lineups INT,
games_minutes INT,
games_number INT,
games_position VARCHAR(255),
games_rating INT,
games_captain enum('true','false'),
goals_total INT,
goals_conceded INT,
goals_assists INT,
goals_saves INT,
cards_yellow INT,
cards_yellowred INT,
cards_red INT,
penalty_won INT,
penalty_commited INT,
penalty_scored INT,
penalty_missed INT,
penalty_saved INT);
